package difficultyLevels.easy.t387FirstUniqueCharacterInAString

import scala.collection.mutable

/**
 * Given a string, find the first non-repeating character in it and return its index. If it doesn't exist, return -1.
 */
object Solution extends App {
  def firstUniqChar(s: String): Int = {
    s.find(c => s.count(c == _) == 1).map(s.indexOf(_)).getOrElse(-1)
  }
  def firstUniqChar1(s: String): Int = {
    s.foldLeft(mutable.LinkedHashMap[Char, Int]())((acc, cur) => acc + (cur -> (acc.getOrElse(cur, 0) + 1))).find(_._2 == 1).map(c => s.indexOf(c._1)).getOrElse(-1)
  }
  val s0 = "leetcode" //0
  val s1 = "loveleetcode" //2
  val s2 = ""
  val res0 = firstUniqChar(s2)
  val res = firstUniqChar1(s0)
  println(res)
}
